var handleDataTableAutofill = function () {
        "use strict";
        if (0 !== $("#data-table").length) {
            $("#data-table").DataTable({
                autoFill: !0,
                responsive: !0
            })
        }
    },
    PageDemo = function () {
        "use strict";
        return {
            init: function () {
                handleDataTableAutofill()
            }
        }
    }();
